import React from "react";
import CloseIcon from '@mui/icons-material/Close';
const ToDoLists=(props)=>{
    return (<> 
                <div className="todo_style">
                
                    
                    <li>{props.text}</li>
                </div>
            </>
           );
};
export default ToDoLists;
